function Activity(props) {
    return <td>{props.value}</td>
}

function ParticipationCheckbox(props) {
    return <td><input type="checkbox"/></td>
}

function Activities(props) {
    const activities = props.activities;
    const activities_names = activities && activities.map(activity => activity.activity_name.toString())
    const activities_users = activities && activities.map(activity => activity.users_id.toString())

    return (
        <tr>
            {activities_names && activities_names.map(activity_name => <Activity key={activity_name.toString()}
                                                                                    value={activity_name}/>)}
            {activities_users && activities_users.map(activity_users => <ParticipationCheckbox
                                                                                 value={activity_users}/>)}
            <ParticipationCheckbox/>
        </tr>
    );
}

export default Activities;
